script: |
  super -f text -I q13025.spq | sort > q13025.out

inputs:
  - name: q13025.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - col2 NOT BETWEEN - col2 * - - col1 - col2 + + 9 + - col1 * + + 56 AND 90 - - ( + + col2 );
  - name: tab1

outputs:
  - name: q13025.out
    data: |
      51	14	96
      85	5	59
      91	47	68
